function Usuarios() {
    if (localStorage.getItem('privilegio') == '1') {
        
        return (
           <div>
                 <h2 className="ml-3 text-center" style={{ color: "green" }}> Usuarios </h2>
                 <Tabla tabla={"usuarios"}></Tabla>
           </div>
        );
    } else {
        window.location = 'http://localhost:3000/Libros';
    }

}

export default Usuarios;
